import React, { Component } from 'react';
import axios from 'axios'

const list = [
  {
    "id": 1, 
    "title": "One todo",
    "body": "one todo"
  },
  {
    "id": 1, 
    "title": "Two todo", 
    "body": "two todo"
  }
]

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { list };
  }
  render() {
    return (
      <div>
        {this.state.list.map(item => (
          <div key={item.id}>
            <h1>{item.title}</h1>
            <p>{item.body}</p>
            </div>
        ))}
      </div>
    );
  }
}
export default App;
